import { Component } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Component({
  selector: 'app-participant-register',
  templateUrl: 'participant-register.component.html',
  styleUrls: ['participant-register.component.css']
})
export class RegisterComponent {
  participant: any = {
    name: '',
    email: '',
    phone: '',
    user: {
      username: '',
      password: ''
    }
  };

  loading = false;
  successMessage = '';
  errorMessage = '';

  private apiUrl = 'http://localhost:5070/api/Participants/Register'; // ✅ Your API endpoint

  constructor(private http: HttpClient) {}

  onSubmit(form: any) {
    if (form.invalid) {
      this.errorMessage = 'Please fill in all required fields correctly.';
      return;
    }

    this.loading = true;
    this.successMessage = '';
    this.errorMessage = '';

    this.http.post<any>(this.apiUrl, this.participant).subscribe({
      next: (res) => {
        this.successMessage = res.message || 'Participant registered successfully!';
        this.errorMessage = '';
        this.loading = false;

        // Reset form after successful registration
        form.resetForm();
        this.participant = {
          name: '',
          email: '',
          phone: '',
          user: {
            username: '',
            password: ''
          }
        };
      },
      error: (err) => {
        this.errorMessage = err.error || 'An error occurred during registration.';
        this.successMessage = '';
        this.loading = false;
      }
    });
  }
}
<h2>Register Participant</h2>
<form (ngSubmit)="register()">
  <input [(ngModel)]="participant.name" name="name" placeholder="Name" required />
  <input [(ngModel)]="participant.email" name="email" placeholder="Email" required />
  <input [(ngModel)]="participant.phone" name="phone" placeholder="Phone" required />
  <input [(ngModel)]="participant.user!.username" name="username" placeholder="Username" required />
  <input [(ngModel)]="participant.user!.password" name="password" type="password" placeholder="Password" required />
  <button type="submit">Register</button>
</form>

<p>{{ message }}</p>
